import ReactDOM from "react-dom";
import React from "react";
import Heading from "./Heading";
import Paragraph from "./Paragraph";
import List from "./List";

function App() {
    const date=new Date();
    const hours=date.getHours();
    let greeting='';
    let cssData={};
    if(hours>=1 && hours<12){
        greeting="Good Morning";
        cssData.color="green";
    } 
    return (
        <>
            <Heading />
            <Paragraph />
            <List />
        </>
    );
}
export default App;
